import React, {Component} from "react";
import {Container} from "@material-ui/core";
import './Home.scss';
export class Home extends Component {
    render() {
        return <>
            <div className='home-wrap'>
                <div className='hero-area'>
                    <Container>
                        1
                    </Container>
                </div>
                <div className='icon-area'>
                    <Container>
                        2
                    </Container>
                </div>
                <div className='icon-area'>
                    <Container>
                        3
                    </Container>
                </div>
            </div>
        </>;
    }
}
